import * as c from '../styles/categoryListStyle';

const CategoryListView = () => {
  return (
    <c.CategoryListContainer>
      <c.CategoryListHeader>
        <c.CategoryListHeaderTitle>난생, 난태생 송사리과</c.CategoryListHeaderTitle>
      </c.CategoryListHeader>
      <c.CategoryListBody>
        <c.CategoryListBodyItem>
          <c.CategoryListItemImage></c.CategoryListItemImage>
        </c.CategoryListBodyItem>
        <c.CategoryListBodyItem>
          <c.CategoryListBodyItemTitle>난태생송사리</c.CategoryListBodyItemTitle>
          <c.CategoryListBodyItemIcon>icon</c.CategoryListBodyItemIcon>
        </c.CategoryListBodyItem>
      </c.CategoryListBody>
    </c.CategoryListContainer>
  );
};

export default CategoryListView;
